function Navigation() {
  return (
    <Fragment>
      <div className="container">
        <header></header>
        <nav>
          <a href="#">Menu|</a>
          <a href="#"> Locations|</a>
          <a href="#"> Rewards|</a>
          <a href="#"> Reservation|</a>
        </nav>
      </div>
    </Fragment>
  );
}

export default Navigation;
